import React from "react";
import backgroundWave from "../assets/background-wave.png";

const MailSubscribe = () => {
  return (
    <section className="py-5">
      <div className="container">
        <img src={backgroundWave} alt="" />
      </div>
    </section>
  );
};

export default MailSubscribe;
